public container pack()
{
    return [#CurrentVersion, #CurrentList];
}

public boolean unpack(container _packedClass)
{
    boolean ret;

    int version = conPeek(_packedClass, 1);

    switch (version)
    {
        case #CurrentVersion:
            [version, #CurrentList] = _packedClass;
            ret = true;
            break;
    }

    return ret;
}

/// <summary>
/// Updates the dimensions display object for the Sales orders grid.
/// </summary>
/// <param name="_mode">
/// The state of the dimensions display form.
/// </param>
/// <exception cref="Exception::Error">
/// Incorrect parameter for the function.
/// </exception>
public void updateDesign_SO(InventDimFormDesignUpdate _mode)
{
    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init:
            if (!inventDimFormSetupSO)
            {
                inventDimFormSetupSO  = InventDimCtrl::newFromFormValidDataSource(element, inventDimSO_ds.name());
            }

            InventDimParm inventDimParmLocal;
            inventDimParmLocal.setAllInventDim();
            inventDimParmLocal.clearProductDimensions();
            inventDimFormSetupSO.parmDimParmVisibleGrid(inventDimParmLocal);
        // do continue
        case InventDimFormDesignUpdate::Active:
            inventDimFormSetupSO.formActiveSetup();
            inventDimFormSetupSO.formSetControls(true);
            break;

        default:
            throw error(strFmt("@SYS54195",funcName()));
    }
}

/// <summary>
/// Updates the dimensions display object for the Transfer orders grid.
/// </summary>
/// <param name="_mode">
/// The state of the dimensions display form.
/// </param>
/// <exception cref="Exception::Error">
/// Incorrect parameter for the function.
/// </exception>
public void updateDesign_TO(InventDimFormDesignUpdate _mode)
{
    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init:
            if (!inventDimFormSetupTO)
            {
                inventDimFormSetupTO  = InventDimCtrl::newFromFormValidDataSource(element, inventDimTO_ds.name());
            }
        // do continue
        case InventDimFormDesignUpdate::Active:
            inventDimFormSetupTO.formActiveSetup();
            inventDimFormSetupTO.formSetControls(true);
            break;

        default:
            throw error(strFmt("@SYS54195",funcName()));
    }
}

private void filterOnWHSEnabledWarehousesAndBlankWarehouses(QueryBuildDataSource _queryBuildDataSource)
{
    QueryBuildDataSource qbdsInventLocation = _queryBuildDataSource.addDataSource(tableNum(InventLocation));
    qbdsInventLocation.joinMode(JoinMode::ExistsJoin);
    qbdsInventLocation.addRange(fieldNum(InventLocation, RecId)).value(
            strFmt('((%1.%2 == %3) || ((%1.%2 == %4.%5) && (%4.%6 == NoYes::Yes)))',
                _queryBuildDataSource.name(),
                fieldStr(InventDim, InventLocationId),
                SysQuery::valueEmptyString(),
                qbdsInventLocation.name(),
                fieldStr(InventLocation, InventLocationId),
                fieldStr(InventLocation, WHSEnabled)
            ));
}

