public void init()
{
    super();

    QueryBuildDataSource salesLineQbds = whsInventTransSumDimSO_ds.query().dataSourceTable(tableNum(SalesLine));
    salesLineQbds.addRange(fieldNum(SalesLine, InventTransId));
    salesLineQbds.addRange(fieldNum(SalesLine, RemainInventPhysical)).value('>0');

    salesLineQbds.addLink(fieldNum(WHSInventTransSumDimIssue, InventTransId), fieldNum(SalesLine, InventTransId), whsInventTransSumDimSO_ds.name());

    QueryBuildDataSource whsSalesLineQbds = salesLineQbds.addDataSource(tableNum(WHSSalesLine));
    whsSalesLineQbds.relations(true);
    whsSalesLineQbds.addRange(fieldNum(WHSSalesLine, QtyLeftToLoad)).value('>0');

    QueryBuildDataSource qbdsWHSInventEnabled = salesLineQbds.addDataSource(tableNum(WHSInventEnabled));
    qbdsWHSInventEnabled.joinMode(JoinMode::ExistsJoin);
    qbdsWHSInventEnabled.addLink(fieldNum(SalesLine, ItemId), fieldNum(WHSInventEnabled, ItemId), salesLine_ds.name());

    this.cacheAddMethod(tableMethodStr(SalesLine, whsDisplaySalesOrgin));
    this.cacheAddMethod(tableMethodStr(SalesLine, whsDisplayCustName));
    this.cacheAddMethod(tableMethodStr(SalesLine, whsDisplayCustAvailCredit));
    this.cacheAddMethod(tableMethodStr(SalesLine, whsDisplayItemName));
}

public void displayOption(Common _record, FormRowDisplayOption _options)
{
    if (showUnreservedDemand)
    {
        SalesLine locSalesLine = _record;

        InventQty onOrderQty = locSalesLine.onOrder();

        if (onOrderQty == 0)    // Fully Reserved
        {
            _options.backColor(WinAPI::RGB2int(#WHSPastelGreen));
        }
        else if (onOrderQty != locSalesLine.QtyOrdered)  // Partially Reserved
        {
            _options.backColor(WinAPI::RGB2int(#WHSPastelBlue));
        }
    }

    super(_record, _options);
}

public void init()
{
    super();

    QueryBuildDataSource transferLineQbds = whsInventTransSumDimTO_q.dataSourceTable(tableNum(InventTransferLine));
    transferLineQbds.addRange(fieldNum(InventTransferLine, QtyRemainShip)).value('>0');

    transferLineQbds.addLink(fieldNum(WHSInventTransSumDimIssue, InventTransId), fieldNum(InventTransferLine, InventTransId), whsInventTransSumDimTO_ds.name());

    QueryBuildDataSource whsInventTransferLineQbds = transferLineQbds.addDataSource(tableNum(WHSInventTransferLine));
    whsInventTransferLineQbds.relations(true);
    whsInventTransferLineQbds.addRange(fieldNum(WHSInventTransferLine, QtyLeftToLoad)).value('>0');

    QueryBuildDataSource qbdsWHSInventEnabled = transferLineQbds.addDataSource(tableNum(WHSInventEnabled));
    qbdsWHSInventEnabled.joinMode(JoinMode::ExistsJoin);
    qbdsWHSInventEnabled.addLink(fieldNum(InventTransferLine, ItemId), fieldNum(WHSInventEnabled, ItemId), inventTransferLine_ds.name());

    QueryBuildDataSource transferTableQbds = whsInventTransferLineQbds.addDataSource(tableNum(InventTransferTable));
    transferTableQbds.addLink(fieldNum(InventTransferLine, TransferId), fieldNum(InventTransferTable, TransferId), inventTransferLine_ds.name());
    transferTableQbds.addRange(fieldNum(InventTransferTable, TransferStatus)).value(SysQuery::value(InventTransferStatus::Created));

    this.cacheAddMethod(tableMethodStr(InventTransferLine, whsDisplayItemName));
    this.cacheAddMethod(tableMethodStr(InventTransferLine, whsDisplayToWarehouse));
}

public void displayOption(Common _record, FormRowDisplayOption _options)
{
    if (showUnreservedDemand)
    {
        InventTransferLine locInventTransferLine = _record;

        InventQty qtyReservedPhysical;
        InventQty pdsCWQtyReservPhysical;

        [qtyReservedPhysical, pdsCWQtyReservPhysical] = locInventTransferLine.qtyReservedPhysical();

        InventQty onOrderQty = locInventTransferLine.QtyTransfer - qtyReservedPhysical;

        if (onOrderQty == 0)    // Fully Reserved
        {
            _options.backColor(WinAPI::RGB2int(#WHSPastelGreen));
        }
        else if (onOrderQty != locInventTransferLine.QtyTransfer)   // Partially Reserved
        {
            _options.backColor(WinAPI::RGB2int(#WHSPastelBlue));
        }
    }

    super(_record, _options);
}

