void clicked()
{
    WHSInventTransSumDimIssue inventTransSumDim;

    super();

    if (tabPageSalesOrders.isActivePage())
    {
        for (inventTransSumDim = whsInventTransSumDimSO_ds.getFirst(true) ? whsInventTransSumDimSO_ds.getFirst(true) : whsInventTransSumDimSO_ds.cursor();
             inventTransSumDim;
             inventTransSumDim = whsInventTransSumDimSO_ds.getNext())
        {
            whsReleaseToWarehouseForm.addInventSumDimFromTransIdDimensionHandlingQty(inventTransSumDim.InventTransId,
                                                                    inventTransSumDim.InventDimId,
                                                                    inventTransSumDim.ItemId,
                                                                    PdsGlobal::pdsIsCWItem(inventTransSumDim.ItemId)
                                                                        ? inventTransSumDim.SumOfPdsCWQty : inventTransSumDim.SumOfQty,
                                                                    whsTmpReleaseToWarehouse,
                                                                    WHSModule::Sales);
        }

        whsInventTransSumDimSO_ds.executeQuery();
    }
    else if (tabPageTransferOrders.isActivePage())
    {
        for (inventTransSumDim = whsInventTransSumDimTO_ds.getFirst(true) ? whsInventTransSumDimTO_ds.getFirst(true) : whsInventTransSumDimTO_ds.cursor();
             inventTransSumDim;
             inventTransSumDim = whsInventTransSumDimTO_ds.getNext())
        {
            whsReleaseToWarehouseForm.addInventSumDimFromTransIdDimensionHandlingQty(inventTransSumDim.InventTransId,
                                                                  inventTransSumDim.InventDimId,
                                                                  inventTransSumDim.ItemId,
                                                                  PdsGlobal::pdsIsCWItem(inventTransSumDim.ItemId)
                                                                      ? inventTransSumDim.SumOfPdsCWQty : inventTransSumDim.SumOfQty,
                                                                  whsTmpReleaseToWarehouse,
                                                                  WHSModule::Transfer);
        }

        whsInventTransSumDimTO_ds.executeQuery();
    }

    whsTmpReleaseToWarehouse_ds.executeQuery();
}

void clicked()
{
    QueryRun                  qr;
    WHSInventTransSumDimIssue inventTransSumDim;

    super();

    if (tabPageSalesOrders.isActivePage())
    {
        whsInventTransSumDimSO_ds.executeQuery();
        qr = whsInventTransSumDimSO_ds.queryRun();

        do
        {
            inventTransSumDim = qr.get(tableNum(WHSInventTransSumDimIssue));
            whsReleaseToWarehouseForm.addInventSumDimFromTransIdDimensionHandlingQty(inventTransSumDim.InventTransId,
                                                                    inventTransSumDim.InventDimId,
                                                                    inventTransSumDim.ItemId,
                                                                    PdsGlobal::pdsIsCWItem(inventTransSumDim.ItemId)
                                                                        ? inventTransSumDim.SumOfPdsCWQty : inventTransSumDim.SumOfQty,
                                                                    whsTmpReleaseToWarehouse,
                                                                    WHSModule::Sales);
        }
        while (qr.next());

        whsInventTransSUmDimSO_ds.executeQuery();
    }
    else if (tabPageTransferOrders.isActivePage())
    {
        whsInventTransSumDimTO_ds.executeQuery();
        qr = whsInventTransSumDimTO_ds.queryRun();

        do
        {
            inventTransSumDim = qr.get(tableNum(WHSInventTransSumDimIssue));
            whsReleaseToWarehouseForm.addInventSumDimFromTransIdDimensionHandlingQty(inventTransSumDim.InventTransId,
                                                                    inventTransSumDim.InventDimId,
                                                                    inventTransSumDim.ItemId,
                                                                    PdsGlobal::pdsIsCWItem(inventTransSumDim.ItemId)
                                                                        ? inventTransSumDim.SumOfPdsCWQty : inventTransSumDim.SumOfQty,
                                                                    whsTmpReleaseToWarehouse,
                                                                    WHSModule::Transfer);
        }
        while (qr.next());

        whsInventTransSumDimTO_ds.executeQuery();
    }

    whsTmpReleaseToWarehouse_ds.executeQuery();
}

